import numpy as np



def resize(img):


    h, w, _ = img.shape
    if w < (1.7 * h):
        w_new = int(h * 1.7)
        shift_x = (w_new - w) // 2
        M = np.array([[1, 0, shift_x],
                      [0, 1, 0]], dtype=np.float32)
        img = cv2.warpAffine(img, M, (w_new, h))
    h, w, _ = img.shape
    # print(index)
    # print(w, h)
    if (h >= 2000):
        img = cv2.resize(img, (w // 5, h // 5))
    elif (h >= 1500):
        img = cv2.resize(img, (w // 4, h // 4))
    elif (h >= 1000):
        img = cv2.resize(img, (w // 3, h // 3))
    else:
        img = cv2.resize(img, (w // 2, h // 2))
    # borderwidth = int((x * 16 / 9 - y) / 2)
    # # print(pic, borderwidth)
    # img = cv2.copyMakeBorder(img, 0, 0, borderwidth, borderwidth, cv2.BORDER_CONSTANT, value=(255, 0, 0))
    return img
